import ReactDOM from "react-dom/client";

import "./index.css";

const BookList = () => {
  return (
    <section className="booklist">
      <Book></Book>
      <Book></Book>
      <Book></Book>
      <Book></Book>
    </section>
  );
};

const Book = () => {
  return (
    <article className="book">
      <img
        src="https://images-na.ssl-images-amazon.com/images/I/61KI7oL-u9L._AC_UL900_SR900,600_.jpg"
        alt="The Woman in Me"
      />
      <h2>The Woman in Me</h2>
      <h4> Britney Spears </h4>
    </article>
  );
};

const root = ReactDOM.createRoot(document.getElementById("root"));

